<script>
import RegisterModal from '../Modals/RegisterModal.vue';

     export default {

         component : RegisterModal,


     data() {

             return{
                 type: 'password',
                 load_spin: 'hidden',
                 hidden_lock: 'hidden',
                 show_lock: '',
                 show: 'hidden',
                 errors: [],
                 error_border : '',
                 phone_number : '',
                 formData: {
                     email: '',
                     username: '',
                     name: '',
                     date_of_birth: '',
                     phone_number: '',
                     ref_code: '',
                     password: '',
                     password_confirmation: '',
                 }
             }



         },

         methods: {


             showPassword(){
                 if(this.type === 'password')
                 {
                     this.type = 'text';
                     this.hidden_lock = '';
                     this.show_lock = 'hidden';

                 }
                 else{
                     this.type = 'password';
                     this.show_lock = '';
                     this.hidden_lock='hidden';
                 }
             },

            handleRegistration(){
                    this.load_spin = '',

                            this.$store.dispatch('register', this.formData).then(response => {
                                    this.show = '';
                                    this.phone_number = this.formData.phone_number;
                                    console.log(response.message);
                                    // this.load_spin='hidden';
                            })
                            .catch(error => {
                                 this.errors = this.$store.getters.errorForm;
                                 this.error_border  = 'border-red-600';
                                 this.load_spin='hidden';
                                console.error(this.$store.getters.errorForm);
                            })



            },





         }


     }

</script>
